import * as React from "react";

import Navbars from "../Navbar/navbarHome";
import Footer from "../Footer/Footer";
import { Link } from "react-router-dom";
import { data, data2, data3, data4, data5 } from "../Data/data";
import { IconButton, Input, TextField, Autocomplete, Box } from "@mui/material";

import { MdArrowDropDown } from "react-icons/md";

const Customer = () => {
  const { innerWidth: width, innerHeight: height } = window;
  const [type, settype] = React.useState(null);
  const [trantype, setTranstype] = React.useState("");
  const [textarea, setTextarea] = React.useState("");
  const [price, setPrice] = React.useState("");
  const [tranfrom, setTranfrom] = React.useState("");
  const [tranto, setTranto] = React.useState("");
  const [file, setFile] = React.useState("");
  const [promo, setPromo] = React.useState("");

  const handleChange = (event) => {
    setTextarea(event.target.value);
  };

  const set_price = (trantype) => {
    console.log("trantype :", trantype);
    if (trantype === "Article") {
      setPrice("15 $");
    } else if (trantype === "Identification Card") {
      setPrice("20 $");
    } else if (trantype === "Family Status Registration") {
      setPrice("25 $");
    } else if (trantype === "Personal information") {
      setPrice("35 $");
    } else if (trantype === "Civil Registration Certificate") {
      setPrice("45 $");
    } else if (trantype === "Certificate of use (the noun prefix") {
      setPrice("55 $");
    } else {
      setPrice("100 $");
    }
  };

  const promotion = (x) => {
    setPromo(x);
    window.scrollTo(0, 1500);
    set_price(trantype);
  };

  return (
    <>
      <header className="App-header">
        <Navbars />
      </header>

      <div>
        <div>
          <div
            style={{
              top: 100,
              background: "#97D5FF",
              opacity: 0.3,
              filter: "blur(20px)",
              position: "absolute",
              width: 400,
              height: 400,
              left: 400,
              borderRadius: 200,
            }}
          ></div>

          <div
            style={{
              top: 100,
              background: "#FFEDB2",
              opacity: 0.3,
              filter: "blur(20px)",
              position: "absolute",
              width: 400,
              height: 400,
              left: 700,
              borderRadius: 200,
            }}
          ></div>
        </div>

        <div
          style={{
            textAlign: "center",
            justifyItems: "center",
            width: 1100,
            display: "inline-grid",
            marginTop: 50,
          }}
        >
          <div>
            <p
              style={{
                fontWeight: "bold",
                fontSize: 56,
                color: "#0097FE",
              }}
            >
              Customer
            </p>
          </div>
          <div>
            <p style={{ fontSize: 30, color: "#444444" }}>
              For customers who want to translate documents translator hero
              There is a translation system that calculates all costs. Including
              professional translators who guarantee excellent translation
              quality.
            </p>
          </div>
          <div
            style={{
              position: "absolute",
              top: 380,
            }}
          >
            <button
              className="box5"
              style={{ width: 220, height: 50, borderRadius: 40 }}
            >
              <Link
                to="/Signup"
                style={{
                  color: "#FFFF",
                  fontSize: 18,
                  lineHeight: 21,
                  textDecorationLine: "none",
                }}
              >
                Get Start
              </Link>
            </button>
          </div>
        </div>
      </div>

      <div
        style={{
          position: "absolute",
          top: height * 0.7,
          width: width,
          height: 800,
        }}
      >
        <div>
          <div
            style={{
              textAlign: "center",
              marginBottom: 10,
            }}
          >
            <p
              style={{
                fontWeight: "bold",
                fontSize: 56,
                color: "#0097FE",
              }}
            >
              Your Order
            </p>
          </div>

          <div>
            {file === "" ? (
              <div
                style={{
                  position: "absolute",
                  left: width * 0.08,
                  width: width * 0.35,
                  height: 670,
                  background: "#FFFFFF",
                  border: "1px solid #E5E5E5",
                  boxSizing: "border-box",
                  float: "left",
                  borderRadius: 20,
                }}
              >
                <label htmlFor="icon-button-file">
                  <Input
                    accept="image/*"
                    id="icon-button-file"
                    type="file"
                    style={{ display: "none" }}
                    onChange={(e) => setFile(e.target.value)}
                  />
                  <IconButton
                    color="primary"
                    aria-label="upload picture"
                    component="span"
                  >
                    <p
                      style={{
                        fontWeight: "bold",
                        fontSize: 24,
                        lineHeight: 24,
                        color: "#B5B5B5",
                      }}
                    >
                      Upload File
                    </p>
                  </IconButton>
                </label>
              </div>
            ) : (
              <div
                style={{
                  position: "absolute",
                  left: width * 0.04,
                  width: width * 0.35,
                  height: 670,
                  background: "#FFFFFF",
                  border: "1px solid #E5E5E5",
                  boxSizing: "border-box",
                  float: "left",
                  borderRadius: 20,
                }}
              >
                <label htmlFor="icon-button-file">
                  <Input
                    accept="image/*"
                    id="icon-button-file"
                    type="file"
                    style={{ display: "none" }}
                    onChange={(e) => setFile(e.target.value)}
                  />
                  <IconButton
                    color="primary"
                    aria-label="upload picture"
                    component="span"
                  >
                    <p
                      style={{
                        fontWeight: "bold",
                        fontSize: 24,
                        lineHeight: 24,
                        color: "#B5B5B5",
                      }}
                    >
                      `${file}`
                    </p>
                  </IconButton>
                </label>
              </div>
            )}

            <div
              style={{
                position: "absolute",
                width: width * 0.55,
                height: 670,
                border: "1px solid #E5E5E5",
                boxSizing: " border-box",
                borderRadius: 20,
                left: width * 0.42,
                padding: 10,
                textAlign: "left",
                borderLeft: "none",
                borderBottomLeftRadius: "unset",
                borderTopLeftRadius: "unset",
              }}
            >
              <div style={{ float: "left", marginLeft: 90 }}>
                <div style={{ marginBottom: 10 }}>
                  <p
                    style={{
                      fontWeight: "bold",
                      fontSize: 24,
                      color: "#333333",
                    }}
                  >
                    Document type
                  </p>
                </div>
